Mommy Got Boobs - Kayla Paige - Film Score

February 25, 2011

When her son decides to use her house to shoot a film school project, Kayla tries her best to be supportive by bringing the boys brownies. Although her son shoos her away, Ms. Kayla's hourglass figure catches the eye of young Rocco, who decides that he's interested in tasting a lot more than just her brownies!
